import About from "./components/About";
import Map from "./components/Map";
import { GlobalStyle, Bttn } from "./styles";

function App() {
  return (
    <>
      <GlobalStyle />
      <Map />
      <Bttn className="about-bttn" onClick={() => openAbout()}>
        More Information
      </Bttn>

      <About />
    </>
  );
}

export default App;
